6.26 GENERAL TERMS AND CONDITIONS - CAPACITY RELEASE

26.	CAPACITY RELEASE

       26.1	Purpose

       This Section sets forth the specific terms and conditions which shall apply on a uniform, non-discriminatory basis to the right of firm Part 284 customers to release capacity entitlements on the Transporter's system. 

       26.2	Applicability 

       This Section is applicable to any customer that has executed a service agreement for firm transportation.  Any such customer shall have the right to release any portion of the firm capacity entitlements it holds provided that the capacity released is acquired by a Replacement Customer pursuant to the terms of this Section. 

       26.3	General Provisions 

       Any firm customer is eligible to release its firm transportation capacity for use by a Replacement Customer subject to the provisions of this Article. 

       (i)	A Releasing Customer may release any portion of its capacity for a minimum term of one day up to the remaining term of its firm service agreement. 

       (ii)	Any Replacement Customer which has previously contracted for released capacity may also release the capacity to another party as long as the remaining term for the released capacity is for more than one month.  While there is no restriction on the number of times capacity can be released, the original terms and conditions on release imposed by the Releasing Customer, including any right to recall the capacity will continue to apply to all subsequent releases. 

       (iii)	Any party interested in acquiring capacity through this Capacity Release Program must submit all credit information required in Section 21 of these General Terms and Conditions and be prequalified before the party can submit bids under Transporter's capacity release program.

       (iv)	Transporter will enter into a Service Agreement with the Replacement Customer prior to the commencement of service which confirms the terms and conditions applicable to the released capacity.  A Replacement Customer acquires all rights and obligations of the Releasing Customer except that it will not be permitted to change the primary receipt and delivery points specified in its service agreement unless the subject capacity has been released on a permanent, non-recallable basis.  A Releasing Customer or Replacement Customer may segment its capacity on Transporter's pipeline, consistent with Section 22Section 8A of the General Terms and Conditions.

       (v)	Irrespective of the release of its capacity, the Releasing Customer remains bound and liable for performance under its service agreement unless excused in writing by Transporter.  The excuse of performance under a service agreement of a Releasing Customer shall be at Transporter's sole discretion, and may be conditioned on exit fees or other requirements.

       (vi) A Releasing Customer may release capacity on a firm or recallable basis, but not both simultaneously.

       (vii)	Any specific release conditions requested by a Releasing Customer must relate solely to acquiring capacity on the Transporter's system, be operationally feasible, and be nondiscriminatory to other Shippers.

       (viii) Upon electronic notification to Transporter, a bid may be withdrawn after it is received by Transporter at any time prior to the expiration of the bidding period.  Once a bid from an approved bidder is accepted by Transporter, it shall be considered a legally binding agreement.  Transporter will post all completed release transactions on its IWS.

       (ix) If the release of capacity is for more than one year, bids for released capacity, including bids for released capacity under Negotiated Rate agreements, may not exceed the maximum tariff rate including all surcharges for the applicable service set forth in Transporter's FERC Gas Tariff, as may be changed from time to time.  If the release of capacity is for one year or less, bids for released capacity may exceed the maximum tariff rate including all surcharges for the applicable service set forth in Transporter's FERC Gas Tariff, as may be changed from time to time and are not subject to any rate limitation.  Bids may be adjusted to reflect either a daily or monthly rate as well as any other time-period rate.  Further, the format of a bid should include the same number of decimal places as the rates included elsewhere in this tariff.

       26.4	Notice by Releasing Customer 

       A Releasing Customer that wishes to place capacity up for bid through Transporter's Capacity Release Program shall submit a complete notice to the Transporter's IWS that it elects to release firm capacity.  The notice shall set forth the following: 

       (i) Releasing Customer's name and the name and title of the individual authorizing the release of capacity;  

       (ii) Service agreement number; 

       (iii)	The maximum and minimum quantity of firm capacity which the Releasing Customer desires to release, expressed as a numeric quantity per day for transportation service; 

       (iv) The primary points of receipt and delivery at which the customer will release the capacity and the capacity to be released at each point;  

       (v) Whether the release is firm or recallable and subject to re-put, and if so, the specific conditions for recall of the capacity and the re-put method and rights, if applicable; 

       (vi) The requested effective date and the term of the release; 

       (vii)	whether the proposed release is to an asset manager as part of an asset management arrangement as defined in Section 284.8(h)(3) of the Commission's regulations or to a marketer participating in a state-mandated retail assess program as defined in Section 284.8(h)(4) of the Commission's regulations, and, if the proposed release is part of an asset management arrangement, the volumetric level of the asset manager's delivery or purchase obligation and the time period during which that obligation is in effect;

       (viii) whether the Releasing Customer will allow the Replacement Customer to re-release the capacity acquired from the Releasing Customer;

       (ix) Whether the Releasing Customer is willing to consider release for a shorter time period, and the time period that will be considered;

       (x) Whether contingent bids will be accepted for evaluation and, if so, for what time period each contingent bidder will be allowed to meet or eliminate the contingency; and, if not met or eliminated, all details concerning the evaluation of other bids, including when the next highest bidder will be obligated to acquire the capacity. 

       (xi)	Whether the Releasing Customer is willing to consider releasing capacity at a minimum rate, including all surcharges, or at a rate lower than the Maximum Reservation Rate for the applicable service, or if the Releasing Customer is willing to consider bids on a volumetric basis, the minimum reservation charge stated on a volumetric basis. 

       (xii)	Whether bids should be submitted in dollars and cents or percentages of maximum tariff rate. 

       (xiii) Whether the Releasing Customer wants Transporter to market its released capacity; 

       (xiv) The criteria which Transporter should apply in determining the "best bid" and any tie-breaker to be applied in the event of equal bids, may be one of the following three standard evaluation methods; 1) highest rate, 2) net revenue and 3) present value or such other methodology as defined by the Releasing Customer.  Any said alternative criteria must be objectively stated and non-discriminatory. However, any method other than the three standard methods listed above may be evaluated outside the Capacity Release Timeline outlined in Article 26.8; 

       (xv) The length of the bidding period desired. 

       Releasing Customer shall not be allowed to specify an extension of the original Bid Period or the prearranged deal matching period without posting a new release.

       Transporter shall post offers and bids, including prearranged deals upon receipt, unless Releasing Customer requests otherwise.  If a Releasing Customer requests a posting time, Transporter shall support such request insofar as it comports with the standard timeline set forth in NAESB standard 5.3.2.

       The Releasing Customer may withdraw its Notice at any time prior to the close of the Bid Period associated with such notice, where unanticipated circumstances justify the withdrawal and no bids meeting the minimum conditions have been made.  The Releasing Customer's notice will be legally binding on the Releasing Customer's until the electronic notice of withdrawal is received by Transporter.

       26.5	Notice of Prearranged Release

       If the Releasing Customer has a Prearranged Replacement Customer for the released capacity, it must include in the notice required in this Article 26 the existence of a Prearranged Replacement Customer, the terms of the prearranged deal and whether the Prearranged Replacement Customer is an affiliate of the Releasing Customer.  If the prearranged release is for a term of 31 days or less, or pursuant to an asset management agreement or to a marketer participating in a state-mandated retail access program as both set forth in Section 26.4(ix)-(xv) the information required under Article 26.4 (vii)-(xiii) may be omitted.  Prearranged short-term releases of 31 days or less cannot be rolled over, renewed, or otherwise be extended without complying with the competitive bidding requirements of this Article 26 and may not be re-released to the same Replacement Customer absent following the competitive bidding requirements of this Article 26 (unless such release otherwise qualifies for an exemption from bidding) until 28 days after expiration of the original release.  A contract shall be issued to the Prearranged Replacement Customer in accordance with the Capacity Release timeline under Section 26.8 below.  The Prearranged Replacement Customer may make a nomination at the beginning of the next available nomination cycle. In the event Shipper has not executed the Contract prior to making its nomination, Shipper shall be deemed to have executed Transporter's pro forma Gas Transportation Contract.

       26.6	Offers to Purchase Capacity

       Any party interested in acquiring capacity through Transporter's Capacity Release Program may provide Transporter with a complete offer to purchase capacity.  Transporter will post any such offer on its IWS for the period requested by the offering party.  Transporter shall assess a nominal fee for posting such notices to recover its variable cost of providing such service.

       26.7	Bidding Process

       (a)	Posting by Transporter: Transporter will post the release information on its IWS in accordance with Section 26.8 below.  The bidding period shall commence on the day that the notice of released capacity is posted. In addition to the information provided by the Releasing Customer, the posting will specify the deadline for submitting bids on the capacity and any other information relevant to the submission of the bids.  Such posting will continue for the duration of the bidding period specified in the notice.  No prior posting or bidding shall be required for (1) prearranged releases of capacity at the applicable maximum rate for releases with a term of more than one year or more, (2) for prearranged release which are for a term of 31 days or less, (3) a release of capacity to an asset manager (as defined in Section 284.8(h)(4) of the Commission's regulations);provided that Transporter will post a notice of such transactions within 48 hours of the effective date of release.  Any release of capacity, with the exception of releases to an asset manager or to a marketer participating in a state-regulated retail access program, with a term greater than 31 days and less than or equal to one year must be posted for bidding, regardless of the proposed rate.

       (b)	Bidding Period: The length of the bidding period for released capacity shall be as specified in the notice provided to Transporter by the Releasing Customer, but shall not be less than one (1) business day. All bids must be submitted during the bidding period through the use of the IWS.  Bids which are submitted in some different form or after the bidding period will not be eligible to receive the released capacity.  Each bid for released capacity must contain the following information:

       (i) Bidder's legal, name, address, and the name and title of the individual(s) responsible for authorizing the bid;

       (ii)	The term of the proposed acquisition;

       (iii) The maximum rate(s) Bidder is willing to pay for the capacity stated in ten-thousandths of one dollar ($0.0000) per Dth per day per Month for reservation charges, or in hundredths of one cent (0.00) per Dth for volumetric rate bids;

       (iv) The transportation quantity desired;

       (v)  The desired Receipt and Delivery Point capacity of the transportation service;

       (vi) Whether Replacement Shipper is willing to acquire capacity rights subject to recall by the Releasing Shipper, and 

       (vii)	Whether or not the Bidder is an affiliate of the Releasing Shipper. 

       Offers should be binding until notice of withdrawal is received by the Transportation Service Provider on its Customer Activities Web site. Bids cannot be withdrawn after the bid period ends. 

       26.8	Capacity Release Timeline 

       (a)	The Capacity Release timeline is applicable to all parties involved in the Capacity Release process; however, it is only applicable if 1) all information provided by the parties to the transaction is valid and the acquiring Shipper has been determined to be credit worthy before the capacity release bid is tendered, 2) for indexed-based capacity release transactions, the Releasing Shipper has provided Transporter with sufficient instructions to evaluate the corresponding bid(s) according to the timeline, and 3) there are no special terms or conditions of the release.  Further, the Transporter may complete the capacity release process on a different timeline if the Offer includes unfamiliar or unclear terms and conditions (e.g. designation of an index not supported by Transporter). 

       (b)	Capacity Release Timeline:

       For biddable releases (1 year or less):

       (1)	offers should be tendered by 9:00 A.M. on a Business Day;

       (2)	open season ends no later than 10:00 A.M. on the same or a subsequent Business Day (evaluation period begins at 10:00 A.M. during which contingency is eliminated, determination of best bid is made, and ties are broken);

       (3)	evaluation period ends and award posting if no match required at 11:00 A.M.;

       (4)	match or award is communicated by 11:00 A.M.;

       (5)	match response by 11:30 A.M.;

       (6)	where match required, award posting by 12:00 P.M.;

       (7)	contract issued within one hour of awarding posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

       For biddable releases (more than 1 year):

       (8)	offers should be tendered by 9:00 A.M. on a Business Day;

       (9)	open season ends no less than three 9:00 A.M. to 10:00 A.M. time periods on consecutive Business Days;

       (10)	evaluation period begins at 10:00 A.M. during which contingency is eliminated, determination of best bid is made, and ties are broken;

       (11)	evaluation periods ends and award posting if no match required at 11:00 A.M.;

       (12)	match or award is communicated by 11:00 A.M.;

       (13)	match response by 11:30 A.M.;

       (14)	where match required, award posting by 12:00 P.M.;

       (15)	contract issued within one hour of award posting (with new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

       For non-biddable releases:

       Timely Cycle

       (16)	posting of prearranged deals not subject to bid are due by 12:00 P.M.; 

       (17)	contract issued within one hour of award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time).

       Evening Cycle

       (18)	posting of prearranged deals not subject to bid are due by 5:00 P.M.;

       (19)	contract issued within one hour of award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

       Intraday 1 Cycle

       (20)	posting of prearranged deals not subject to bid are due by 9:00 A.M.;

       (21)	contract issued within one hour of award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

       Intraday 2 Cycle

       (22)	posting of prearranged deals not subject to bid are due by 1:30 P.M.; 

       (23)	contract issued within one hour of award posting (with a new contract number, when applicable); nomination possible beginning at the next available nomination cycle for the effective date of the contract. (Central Clock Time)

      Intraday 3 Cycle
		(24)	posting of prearranged deals not subject to bid are due by 6:00 P.M.

       (25)	contract issued within one hour of award posting (with a new contract number when applicable), nominations possible beginning at the next available nomination cycle for the effective date of the contracts (Central Clock Time) 

       (c)	Nominations accepted after notification of the winning bid. In the event Shipper has not executed the Contract prior to making its nomination, Shipper shall be deemed to have executed Transporter's pro forma Gas Transportation Contract.

       26.9	Awarding of Released Capacity

       Release capacity shall be made available on a non-discriminatory basis in accordance with the timeline described above.  Wherein Transporter will evaluate all bids received, and select the "Best Bid" which will receive the released capacity.  If there are awards of capacity for which there have been multiple bids meeting minimum conditions, the best bid shall be awarded first, until all offered capacity is awarded.  Initially, Transporter will eliminate from consideration those bids which do not meet the minimum conditions established by the Releasing Customer and those bids which have not complied with Transporter's own creditworthiness criteria.  If the Releasing Customer has provided alternative criteria for determining the "Best Bid," Transporter will apply those criteria to determine which bid receives the capacity.  If no evaluation criteria have been provided by the Releasing Customer, Transporter will award the released capacity based on the application of the following criteria:

       (i)	If there is only one valid bid, Transporter will award the released capacity to that Bidder, 

       (ii)	If more than one valid bid is received, Transporter will award the released capacity to the Bidder offering the maximum applicable rate for the maximum term specified by the Releasing Customer.

        (iii)	If more than one valid bid is received and none offers the maximum applicable rate for the maximum term, Transporter will award the capacity to the bid offering the maximum revenue over the minimum term specified by the Releasing Customer.  Such maximum revenue shall be computed from the monthly demand charge or reservation revenues to be received over the minimum term of the release contract, except that under a Negotiated Rate agreement with a minimum quantity, the maximum revenue evaluation shall also include the fixed cost component of the usage revenue at the minimum quantity.

       (iv)	If two or more equal bids are received, Transporter will award the capacity on the basis of the tie-breaker criteria provided by the Releasing Customer.  If no tiebreaker criteria are provided by the Releasing Customer then capacity will be awarded on the basis of a lottery to be held within two (2) business days of the close of the bidding period.  The lottery will be conducted by Transporter on a nondiscriminatory basis and on a one (1) business day's notice to the affected parties who will have the right to attend.  Capacity shall be awarded on the basis of a draw, on an all or nothing basis.

       For less than maximum rate transactions only, converting daily rate to monthly rate is accomplished by multiplying the daily rate times number of days in rate period, dividing the result by number of months in rate period and taking the remainder out to 5 decimal places and rounding up or down to the Transporter's specified decimal place.  Converting a monthly rate to a daily rate is accomplished by multiplying the monthly rate by number of months in rate period, dividing the result by number of days in rate period and taking the remainder out to 5 decimal places and rounding up or down to the transporter's specified decimal place.

       Transporter will not award capacity release offers to the Shipper until and unless the Shipper meets Transporter's creditworthiness requirements applicable to all services that it receives from Transporter, including the service represented by the capacity release.

       26.10	Right of First Refusal 

       In the case of a prearranged bid, if the bid submitted by another Bidder exceeds the value of the bid submitted by the Prearranged Replacement Customer, the Pre-arranged Replacement Customer will be given the opportunity to match the terms of the best bid. Within one (1) hour of the close of the bidding period, Transporter will notify the Releasing Customer and the Prearranged Replacement Customer of the terms of the better bid.  The Prearranged Replacement Customer will then have one (1) hour to match those terms. Otherwise, the capacity will be awarded to the other Bidder. 


       26.11	Capacity Not Released 

       The Releasing Customer shall retain all of the capacity that is not acquired by a Replacement Customer as the result of the bidding process or a prearranged deal. 

       26.12	Notice of Completed Transactions: 

       Immediately after capacity has been awarded pursuant to this Article 26, Transporter will post electronically a notice of completed transaction containing the following information: 

       (i)	term of release; 

       (ii)	price(s) as bid; 

       (iii)	primary receipt and delivery points; 

       (iv)	quantity in Dth; 

       (v)	whether the capacity is firm or firm recallable; 

       (vi)	the name of the Replacement Customer and whether the Replacement customer is affiliated with the Releasing Customer. 

       26.13	Execution of Agreements

       Transporter's acceptance of a bid shall constitute a binding agreement between Transporter and the releasing Customer under which the Releasing Customer releases the capacity described in the accepted bid and a binding agreement between Transporter and the Replacement Customer under which the Replacement Customer acquires those rights of the Releasing Customer that are described in the accepted bid.  Within one hour after posting of the capacity award, Transporter will provide electronically to the Replacement Customer a service agreement with a contract number for the capacity awarded.  The Replacement Customer will be required to execute and return to Transporter within one day after receipt of such, a service agreement reflecting the terms of the released capacity.  Once the service agreement has been executed, the terms of such agreement are not subject to amendment.  At the election of Transporter, the Releasing Customer shall promptly execute such further documents as may be necessary to evidence its release of capacity. 

       26.14	Obligations of Releasing Customer:

       The Releasing Customer shall continue to be responsible and liable for its obligations under the service agreement.  Without limitation, these obligations include the following: 

       (i)	Unless otherwise agreed to by Transporter, the Releasing Customer shall continue to be liable for all demand or reservation and other non-usage related charges owing under its service agreement up to the maximum rate specified in the service agreement, including, but not limited to, any demand or reservation surcharge assessed by Transporter in accordance with Article 17 of this Tariff. 

       (ii)	Transporter shall have the right to seek performance directly from the Releasing Customer with respect to the obligations owed by it to Transporter, before, after, or simultaneously with Transporter's attempt to seek performance from the Replacement Customer who owes obligations under any new service agreement and Transporter shall have no obligation to seek performance from the Replacement Customer with respect to such obligations; 

       (iii)	Each Releasing Customer agrees to protect and indemnify Transporter against, and to release and hold harmless against, any loss, liability or expense (including, without limitation, court costs and attorneys'' fees) incurred or suffered by Transporter or such Releasing Customer arising out of or in connection with the provisions of this Article 26 except for losses, damages, or expenses caused solely by Transporter's own negligence or willful misconduct.

       (iv)	Transporter will continue to bill the Releasing Customer for all reservation and related charges on a monthly basis, and the Releasing Customer shall make payment in accordance with Article 6 of this tariff. Simultaneous with the billings to Replacement Customer, pursuant to Article 15 (ii) below, Transporter shall credit to Releasing Customer, all reservation and related charges billed to Replacement Customer. 

       (v)	For all released capacity subject to recall rights, the following recall notification periods shall apply:

       Timely Recall Notification:

       (1)	Releasing Shipper recalling capacity shall provide notice of such recall to the Transporter and the first Replacement Shipper no later than 8:00 a.m. on the day that Timely nominations are due;

       (2)	Transporter shall provide notification of such recall to all affected Replacement Shippers no later than 9:00 a.m. on the day that Timely nominations are due (Central Clock Time);

       Early Evening Recall Notification:

       (3)	Releasing Shipper recalling capacity shall provide notice of such recall to the Transporter and the first Replacement Shipper no later than 3:00 p.m. on the day that Evening nominations are due;

       (4) 	Transporter shall provide notification of such recall to all affected Replacement Shippers no later than 4:00 P.M. on the day that Evening nominations are due (Central Clock Time);

       Evening Recall Notification:

       (5)	Releasing Shipper recalling capacity shall provide notice of such recall to the Transporter and the first Replacement Shipper no later than 5:00 P.M. on the day that Evening nominations are due;

       (6) 	Transporter shall provide notification of such recall to all affected Replacement Shippers no later than 6:00 P.M. on the day that Evening nominations are due (Central Clock Time);

       Intraday 1 Recall Notification:

       (7)	Releasing Shipper recalling capacity shall provide notice of such recall to the Transporter and the first Replacement Shipper no later than 7:00 A.M. on the day that Intraday 1 nominations are due;

       (8) 	Transporter shall provide notification of such recall to all affected Replacement Shippers no later than 8:00 A.M. on the day that Intraday 1 nominations are due (Central Clock Time);

       Intraday 2 Recall Notification:

       (9)	Releasing Shipper recalling capacity shall provide notice of such recall to the Transporter and the first Replacement Shipper no later than 12:00 P.M. on the day that Intraday 2 nominations are due;

       (10) 	Transporter shall provide notification of such recall to all affected Replacement Shippers no later than 1:00 P.M. on the day that Intraday 2 nominations are due (Central Clock Time).

	Intraday 3 Recall Notification:

       (11)	Releasing Shipper recalling capacity shall provide notice of such recall to the Transporter and the first Replacement Shipper no later than 4:00 P.M. on the day that Intraday 3 nominations are due;

       (12)	Transporter shall provide notification of such recall to all affected Replacement Shippers no later than 5:00 P.M. on the day that Intraday 3 nominations are due. 

For recall notification provided to Transporter prior to the recall notification deadline specified in NAESB WGC Standard No. 5.3.44 and received between 7:00 a.m. and 5:00 p.m., Transporter shall provide notification to all affected Replacement Shippers no later than one hour after receipt of such recall notification. For recall notification provided to Transporter after 5:00 P.M. and prior to 7:00 A.M., Transporter shall provide notification to all affected Replacement Shippers no later than 8:00 A.M. after receipt of such recall notification.

       (vi)	For the recall notification provided to Transporter, the quantity shall conform to Transporter's capacity recall notification specification. Transporter requires that the quantity must be expressed in terms of adjusted total released capacity entitlements based upon the Elapsed Prorata Capacity.  

       (vii)	Reput method and rights should be specified at the time of the deal. Reput methods and rights are individually negotiated between the Releasing Shipper and the Replacement Shipper.  

       (viii) In the event of termination of Releasing Customer's Service Agreement with Transporter, Replacement Customer's Service Agreement with Transporter is deemed terminated unless Replacement Customer agrees to pay the lower of: (1) the former Releasing Customer's contract rate or (2) the maximum tariff rate for the service for the remainder of the Replacement Customer's service agreement.

       26.15	Obligation of Replacement Customer: By executing a service agreement for released capacity, the Replacement Customer agrees that it will comply with the terms and conditions of Transporter's FERC Gas Tariff 

       (i)	The Replacement Customer agrees to indemnify Transporter against and to release and hold Transporter harmless against any loss, liability, or expense (including, without limitation, court costs and attorneys' fees) incurred or suffered by Transporter or the Replacement Customer arising out of or in connection with the provisions of this Article except

       (ii)	The Replacement Customer shall be liable for the portion of the demand or reservation charges specified in its service agreement, along with all commodity related charges applicable to its service utilization, and all applicable penalties.  Transporter will bill the Replacement Customer on a monthly basis and the Replacement Customer shall make payment in accordance with Section 6 of this tariff. 

       26.16	Marketing Fee 

       Transporter will charge a Marketing fee to be negotiated between Transporter and the Releasing Customer where Transporter successfully markets the released capacity on the Releasing Customer's behalf. 

       26.17	Formal Notices

       Transporter will provide the original releasing shipper with Internet E-mail notification reasonably proximate in time with any of the following formal notices given by Transporter to the releasing shipper's replacement shipper(s), of the following: 

       (i) 	Notice to the replacement shipper regarding the replacement shipper's past due, deficiency, or default status pursuant to Transporter's tariff;

       (ii) 	Notice to the replacement shipper regarding the replacement shipper's suspension of service notice;

       (iii)	Notice to the replacement shipper regarding the replacement shipper's contract termination notice due to default or credit-related issues; and

       (iv)	Notice to the replacement shipper that the replacement shipper(s) is no longer creditworthy and has not provided credit alternative(s) pursuant to Transporter's tariff.

       26.18 Permanent Capacity Releases

       	To the extent that any Customer desires to release all or any part of its firm rights on a permanent basis, the procedures specified in this Section 26 shall apply.  In addition, the Replacement Customer that will acquire the capacity from Customer must submit a request for service electronically to Transporter and provide the credit information as required by Section 21 of the General Terms and Conditions.  For any permanent capacity release, the minimum bid acceptable to Transporter shall be a bid for the remainder of the term of Customer's service agreement at the rate(s) Customer is obligated to pay Transporter for the capacity release if it has a reasonable basis to conclude that is will not be financially indifferent to the release.  If Customer's request to permanently release capacity is denied by Transporter, Transporter shall notify Customer via email and shall include in the notification the reasons for such denial.

6.5 GENERAL TERMS AND CONDITIONS - BILLINGS

5.	BILLINGS

       5.1	Monthly Billing: Transporter shall render an invoice on or before the ninth business day of each month, (defined as postmarked, time-stamped and delivered to the designated site) for all gas delivered and gas services furnished during the preceding calendar month.  The form and content of such invoice as well as any backup shall comply with the Common Codes Standards adopted by the NAESB and incorporated by reference in Section 284.10 of the Commission's Regulations.  Each such invoice shall contain a statement reflecting the following for service under each applicable Rate Schedule:

       (i)	The quantity of gas in Dth received by Transporter for Shipper's account during the preceding month;

       (ii)	The quantity of gas in Dth scheduled for delivery by Transporter for Shipper's account during the preceding month;

       (iii)	The imbalance, if any, between the quantity of gas received by Transporter and the quantity of gas actually delivered by Transporter for Shipper or for Shipper's account, net of any applicable Fuel Reimbursement whereby any transfer imbalance will be listed as a separate charge, if applicable;

       (iv)	The computation of charges due and payable by Shipper for services rendered during the preceding month, including any applicable outstanding balances;

       (v)	The outstanding balances by invoice; and

       (vi)	Any pooling point transactions and charges, if applicable. 

5.2	Right of Examination: Both Transporter and Shipper shall have the right to examine at any reasonable time the books, records and charts of the other to the extent necessary to verify the accuracy of any statement, chart or computation made under or pursuant to the provisions of the transportation contracts.
